#include <bits/stdc++.h>

using namespace std;

const int N = 1e6;
const string result = "";

int main() {
#ifdef wxh010910
  freopen("input.txt", "r", stdin);
#endif
  vector<int> primes, minp(N + 1);
  for (int i = 2; i <= N; ++i) {
    if (!minp[i]) {
      minp[i] = i;
      primes.push_back(i);
    }
    for (auto p : primes) {
      if (i * p > N) {
        break;
      }
      minp[i * p] = p;
      if (i % p == 0) {
        break;
      }
    }
  }

  vector<vector<int>> powers;
  map<vector<int>, int> id;
  vector<int> current(7);
  
  function<void(int, int, int)> dfs = [&](int x, int value, int maxe) {
    id[current] = powers.size();
    powers.push_back(current);
    for (int e = 1; e <= maxe; ++e) {
      value *= primes[x];
      if (value > N) {
        break;
      }
      current[x] = e;
      dfs(x + 1, value, e);
      current[x] = 0;
    }
  };

  vector<int> a(60), b(60);

  function<bool(int, int, int, long long, long long, int)> check = [&](int x, int maxa, int maxb, long long valuea, long long valueb, int limit) {
    if (!a[x] && !b[x] && valuea == valueb) {
      return true;
    }
    if (!a[x] && !b[x] && !valuea && !valueb) {
      return false;
    }
    for (int ea = max(a[x] - limit, 0); ea <= min(a[x] + limit, maxa); ++ea) {
      int temp = limit - abs(a[x] - ea);
      for (int eb = max(b[x] - temp, 0); eb <= min(b[x] + temp, maxb); ++eb) {
        if (check(x + 1, ea, eb, valuea * (ea + 1), valueb * (eb + 1), temp - abs(b[x] - eb))) {
          return true;
        }
      }
    }
    return false;
  };

  dfs(0, 1, 20);
  vector<vector<int>> answer(powers.size(), vector<int> (powers.size()));
  /*
  for (int i = 0; i < powers.size(); ++i) {
    for (int j = 0; j < i; ++j) {
      for (int k = 0; k < 7; ++k) {
        a[k] = powers[i][k];
        b[k] = powers[j][k];
      }
      while (!check(0, 60, 60, 1, 1, answer[i][j])) {
        ++answer[i][j];
      }
      putchar(answer[i][j] + 'a');
    }
  }
  */
  int pointer = 0;
  for (int i = 0; i < powers.size(); ++i) {
    for (int j = 0; j < i; ++j) {
      answer[i][j] = result[pointer++] - 'a';
    }
  }

  int q;
  cin >> q;
  while (q--) {
    int x, y;
    cin >> x >> y;
    vector<int> ex(7), ey(7);
    int px = 0, py = 0;
    while (x != 1) {
      int p = minp[x], e = 0;
      while (x % p == 0) {
        x /= p;
        ++e;
      }
      ex.push_back(e);
    }
    sort(ex.begin(), ex.end(), greater<int> ());
    while (y != 1) {
      int p = minp[y], e = 0;
      while (y % p == 0) {
        y /= p;
        ++e;
      }
      ey.push_back(e);
    }
    sort(ey.begin(), ey.end(), greater<int> ());
    ex.resize(7);
    ey.resize(7);
    int idx = id[ex], idy = id[ey];
    if (idx < idy) {
      swap(idx, idy);
    }
    cout << answer[idx][idy] << endl;
  }
  return 0;
}